INSERT INTO `p_dacen` VALUES (1,'ESR','Serpong Data Center','dc_serpong.png',2,273,'22.500 m2 ','DC located in BSD City, a commercial & residential area, away from the location that could become terrorist or demonstration targets (embassies, government offices, crowed area, industrial area)\r\n','EnterpriseDC-Serpongv2.0.pdf','- Located in the Central Business District of BSD City, a major satellite town southwest of Jakarta\n- The area is 40m above sea level , free from fload, away from river , coastline (based from BMKG)\n- Easily accessable via two toll roads from Jakarta (West Jakarta and South Jakarta)\n- Trasportation : bus, shuttle bus, taxi, train\n- Proximity to Firehouse, Police Station, Hospital, Hotel, Amenities\n- Not in the flight path\n- Not close to military base\n- Away from airport, chemical plant, and landfill\n- Not adjacent to a foreign embassy\n- Not located in high crime areas\n- 36 km from CBD Jakarta (1 hour drive via toll road), 40 km from Soekarno-Hatta International Airport\n- Low risk of earthquake, not located above active fault (based on from BMKG)\n- Distance from emergency assistance: 1.2 km from fire house, 2.0 km from police station, 0.5 km from hospital\n- Public transportation: shuttle bus from/to BSD City/Jakarta, taxi\n- Amenities: hotel (0,8 km), food center (0.7 km), hypermarket & food court (0.8 km)',106.6681012,-6.2975484,'sld.png','connectivity.png','21 538 8538',49),(2,'ESN','Sentul Data Center','dc_sentul.png',2,161,'9000 m2','DC located in Sentul City, a commercial & residential area, away from the location that could become terrorist or demonstration targets (embassies, government offices, crowed area, industrial area)','','-DC located in Sentul City, a commercial & residential area, away from the location that could become terrorist or demonstration targets (embassies, government offices, crowed area, industrial area)\r-49 km from CBD Jakarta (1 hour drive via toll road), 77',NULL,NULL,'sld.png','connectivity.png','',NULL),(3,'ESB','Surabaya Data Center ','dc_surabaya.png',2,264,'6600 m2','DC located in Citraland, a commercial & residential area, away from the location that could become terrorist or demonstration targets (embassies, government offices, crowed area, industrial area)','','-DC located in Citraland, a commercial & residential area, away from the location that could become terrorist or demonstration targets (embassies, government offices, crowed area, industrial area)\r-About 700 km air distance from Jakarta\r-18 km from CBD Su',NULL,NULL,'sld.png','connectivity.png','',NULL);
